import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
} from 'owp/wrapper';
import * as TGEvent from 'owp/TGEvent';
import Pop_C0205001 from '../../include/Pop_C0205001';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    header={
                        <OwpSearchHeader url="listOwpProdplan">
                            <div className="w-full">
                                <div className="flex mb-16">
                                    <OwpSearchSelectField
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label="업무분류"
                                        useAll
                                    />
                                    <OwpSearchDateTimePickerMulti
                                        name="sm02"
                                        initNow={true} // TODO: true 인 경우 현재 시로 init (* default = false)
                                        labels={{ start: ' 시작일', end: '종료일' }}
                                        inputProps={{ start: { style: { width: 140 } }, end: { style: { width: 140 } } }}
                                        required={true}
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm03'}
                                        name={'sm03'}
                                        label={'제품명'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'제품배치번호'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm04'}
                                        name={'sm04'}
                                        label={'인수번호'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm04'}
                                        name={'sm04'}
                                        label={'원료명'}
                                        
                                    />
                                </div>
                                <div className="flex">
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm04'}
                                        name={'sm04'}
                                        label={'원료 ID'}
                                        
                                    />
                                    <OwpSearchSelectField
                                        className="w-200"
                                        id={'sm05'}
                                        name={'sm05'}
                                        label="포장용기및 라벨부착상태 확인"
                                        useAll
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm04'}
                                        name={'sm04'}
                                        label={'바코드 ID'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm04'}
                                        name={'sm04'}
                                        label={'비고'}
                                        
                                    />
                                </div>
                            </div>
                        </OwpSearchHeader>
                    }
                    contentToolbar={
                        <OwpToolbar title="원료재입고">
                            <Pop_C0205001/>
                        </OwpToolbar>
                    }
                    content={
                        <React.Fragment>
                            <OwpTreeGrid
                                id="C0205000_01"
                                LayoutUrl={'/assets/data/C0205000_01Def.xml'}
                                DataUrl={'/assets/data/C0202000Data.xml'}
                            />
                        </React.Fragment>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
